-- Add missing Kofax batch records to staging table.

/*
-- Get a list of all possible missing batches

select 
  '''' + BatchID + ''','
  from [STATISTICS]..BATCH 
where 
  CREATIONDTM > convert(datetime,'2015-06-30 07:02:39',120) -- earliest date/time from logs for outage
  and CREATIONDTM < convert(datetime,'2015-07-01 22:59:34',120) -- latest date/time from logs for outage
  and CLASSNAME in('NYSOH-MAIL','NYSOH-FAX')
order by CREATIONDTM asc;

-- now filter it down to only the batches that are actually missing

select '''' || c.batch_guid || ''''
from CORP_ETL_MFB_BATCH_stg bs
right outer join 
(select 'batch_ids from above query one per select' Batch_GUID from dual union all  
select 'batch id from above query ...' Batch_GUID from dual union all
...
select 'batch id from above query ...' Batch_GUID from dual) c
on bs.batch_guid = c.batch_guid
where bs.batch_guid is null;

-- build the insert statements from the list of missing batches from the above query, set stg_insert_job_id to a number not in use in the corp_etl_mfb_batch_stg table 

select 
  'insert into CORP_ETL_MFB_BATCH_STG(BATCH_GUID,BATCH_ID,BATCH_NAME,CREATION_STATION_ID,CREATION_USER_NAME,CREATION_USER_ID,BATCH_CLASS,CREATE_DT,COMPLETE_DT,INSTANCE_STATUS,INSTANCE_STATUS_DT,BATCH_PAGE_COUNT,BATCH_DOC_COUNT,BATCH_ENVELOPE_COUNT,ASF_SCAN_BATCH,CLASSIFICATION_DT,RECOGNITION_DT,VALIDATION_DT,ASF_POPULATE_REPORTS,ASSD_POPULATE_REPORTS,ASED_POPULATE_REPORTS,ASF_RELEASE_DMS,ASSD_RELEASE_DMS,ASED_RELEASE_DMS,BATCH_PRIORITY,STG_DONE_DATE,STG_EXTRACT_DATE,STG_LAST_UPDATE_DATE,STG_PROCESSED_DATE,INSERT_UPDATE,STG_INSERT_JOB_ID,BATCH_COMPLETE_DT,CURRENT_STEP,SOURCE_SERVER,BATCH_DESCRIPTION,REPROCESSED_FLAG,CEJS_JOB_ID) 
  values(''' + BatchID + ''',' + convert(varchar,row_number() over (order by CREATIONDTM asc)) + ',''' + Name + ''',1,''Guy Thibodeau'',''Guy Thibodeau'',''' + ClassName + ''', to_date(''' + convert(varchar,Creationdtm) + ''',''Mon DD yyyy hh:miAM''),null,''Active'',sysdate,null,null,null,''Y'',null,null,null,''N'',null,null,''N'',null,null,1,sysdate,sysdate,sysdate,sysdate,''I'',7,null,''Scan Batch'',''Central'',null,''N'',null);'
from [STATISTICS]..BATCH 
where 
  CREATIONDTM > convert(datetime,'2015-06-30 07:02:39',120) -- date/time from logs
  and CREATIONDTM < convert(datetime,'2015-07-01 22:59:34',120) -- date/time from logs
  and CLASSNAME in('NYSOH-MAIL','NYSOH-FAX')
  and BatchID in ('List of batchids from query above')
  order by CREATIONDTM asc;

*/

